import { connect } from 'react-redux';
import {Text, View, Image, TouchableOpacity } from 'react-native';
import * as selectors from '../../reducers'
import React from 'react';
import styles from './styles'
import { URL } from '../../../configuration'
import { Actions } from 'react-native-router-flux';
import { LinearGradient } from 'expo-linear-gradient';
import { colors } from '../../../configuration';
import { logout } from '../../actions/auth';

const Chats = ({onClick,home}) => (
    <View style={styles.main_container}>
    <LinearGradient
        colors={[colors.primaryB, 'transparent']}
        style={{
            width: '100%',
            height: '100%',
            flexDirection: 'column',
            alignItems: 'flex-start',
            justifyContent: 'flex-start'
        }}
        >
        <View style={(typeof document==='undefined')?styles.container:styles.webcontainer}>
            <View style={styles.row}>
                <Text style={styles.text} >{"CHATS"}</Text>
            </View>
            <TouchableOpacity style={styles.row} onClick={() => onClick}>
                <Image style={styles.icon} source={require('../../public/static/icon/add.png')} />
            </TouchableOpacity>   
        </View>
    </LinearGradient>
    </View>
);

export default connect(
  state => ({
    isAuthenticated: selectors.isAuthenticated(state),
  }),
  dispatch => ({
      onClick(){

      },
      home(){
        if(typeof document !== 'undefined'){
            window.location.href = URL
          }
          else{
            Actions.Home(true)
          }
      }

  }),
)(Chats);
